class Solution {
private:
    vector<vector<vector<int>>> partition(const vector<int> &list, const int &parts) {
        if (list.size() < parts || parts < 1) {
            return {};
        }
        if (list.size() == 1 || parts == 1) {
            return {{list}};
        }
        vector<vector<vector<int>>> ans, prev = partition(vector<int>(list.begin(), list.end() - 1), parts);
        for (auto &partition: prev) {
            for (auto &set: partition) {
                set.push_back(list.back());
                ans.push_back({partition});
                set.pop_back();
            }
        }
        prev = partition(vector<int>(list.begin(), list.end() - 1), parts - 1);
        for (auto &partition: prev) {
            partition.push_back({list.back()});
            ans.push_back({partition});
            partition.pop_back();
        }
        return ans;
    }

    bool check(vector<int> &counts, vector<int> &quantity) {
        if (counts.size() >= quantity.size()) {
            bool satisfy = true;
            for (int i = 1; i <= quantity.size(); i++) {
                if (quantity[quantity.size() - i] > counts[counts.size() - i]) {
                    satisfy = false;
                    break;
                }
            }
            if (satisfy) {
                return true;
            }
        }
        return false;
    }

public:
    bool canDistribute(vector<int> &nums, vector<int> &quantity) {
        std::sort(nums.begin(), nums.end());
        std::sort(quantity.begin(), quantity.end());
        vector<int> countsVector1(1, int(1));
        for (int i = 1; i < nums.size(); i++) {
            if (nums[i] == nums[i - 1]) {
                countsVector1[countsVector1.size() - 1]++;
            } else {
                countsVector1.push_back(1);
            }
        }
        multiset<int> counts(countsVector1.begin(), countsVector1.end());
        for (auto quantityIt = quantity.begin(); quantityIt != quantity.end();) {
            auto countsIt = counts.find(*quantityIt);
            if (countsIt != counts.end()) {
                counts.erase(countsIt);
                quantity.erase(quantityIt);
            } else {
                quantityIt++;
            }
        }
        if (quantity.empty()) {
            return true;
        }
        if(quantity.back()>*--counts.end()){
            return false;
        }
        vector<int> countsVector(counts.begin(), counts.end());
        if (check(countsVector, quantity)) {
            return true;
        }
        for (int i = 1; i <= quantity.size(); i++) {
            vector<vector<vector<int>>> partitions = partition(quantity, i);
            for (const vector<vector<int>> &partition: partitions) {
                vector<int> setsSum;
                setsSum.reserve(partition.size());
                for (const vector<int> &set: partition) {
                    setsSum.push_back(std::accumulate(set.begin(), set.end(), 0));
                }
                std::sort(setsSum.begin(), setsSum.end());
                if (check(countsVector, setsSum)) {
                    return true;
                }
            }
        }
        return false;
    }
};

